import { Identifier, Node, ts } from 'ts-morph';
/**
 * 表达式节点
 *
 * @example width(1, 2, 3)
 */
export default interface IExpressNode {
    /**
     * 名称节点
     *
     * @example width
     */
    name: Identifier;
    /**
     * 值节点列表
     *
     * @example [1, 2, 3]
     */
    value: Node<ts.Node>[];
}
